ht</p><p class="final-stage-words">3 preliminary live trading challenges to earn a spot in the top 10  on the night.</p><ul><li><span class="stage1-words-circle"></span><span>Final 01/01/2019-28/02/2019</span></li><li><span class="stage1-words-circle"></span><span>The Final Live Competition 08/03/2019</span></li></ul></div><div class="stage1-arrows"><span role="img" aria-label="left" tabindex="-1" class="anticon anticon-left stage1-arrows-both"><svg viewBox="64 64 896 896" focusable="false" class="" data-icon="left" width="1em" height="1em" fill="currentColor" aria-hidden="true"><path d="M724 218.3V141c0-6.7-7.7-10.4-12.9-6.3L260.3 486.8a31.86 31.86 0 000 50.3l450.8 352.1c5.3 4.1 12.9.4 12.9-6.3v-77.3c0-4.9-2.3-9.6-6.1-12.6l-360-281 360-281.1c3.8-3 6.1-7.7 6.1-12.6z"></path></svg></span><span role="img" aria-label="right" tabindex="-1" class="anticon anticon-right stage1-arrows-both stage1-arrows-right"><svg viewBox="64 64 896 896" focusable="false" class="" data-icon="right" width="1em" height="1em" fill="currentColor" aria-hidden="true"><path d="M765.7 486.8L314.9 134.7A7.97 7.97 0 00302 141v77.3c0 4.9 2.3 9.6 6.1 12.6l360 281.1-360 281.1c-3.9 3-6.1 7.7-6.1 12.6V883c0 6.7 7.7 10.4 12.9 6.3l450.8-352.1a31.96 31.96 0 000-50.4z"></path></svg></span></div></div><div class="final-prize"><div><p>Grand Final Prize Distributions</p></div><div><div class="prize3-second"><img src="https://lprsc.acycms.com/202005-tradingcup2018/dist/acysecurities/en/cec90e985123366766a3f377a9de0cb2.png"></div><div class="prize3-first"><img src="https://lprsc.acycms.com/202005-tradingcup2018/dist/acysecurities/en/9f6a1cfed1d903763bae8375969178b7.png"></div><div class="prize3-third"><img src="https://lprsc.acycms.com/202005-tradingcup2018/dist/acysecurities/en/1b67c4b14f8a24cafdfe2b9d3029f165.png"></div></div><div><div class="prize3-name-second"><p>Name</p><p>Mr. Shantao Yu</p></div><div class="prize3-name-first"><p>Prize($USD)</p><p class="prize-first">$US84,000</p><p>Total prizes $US120,000.</p></div><div class="prize3-name-third"><p>% Return</p><p class="prize-first">29.12%</p></div></div></div></div><div class="final-prize-small"><div class="final-prize-small-word"><p>Live Grand Final Night</p><p>Final 01/01/2019-28/02/2019</p><p>The Final Live Competition 08/03/2019</p><p>3 preliminary live trading challenges to earn a spot in the top 10  on the night.</p></div><div class="final-prize-small-prize"><p>Grand Final Prize Distributions</p><div class="prize1-small"><p><img src="https://lprsc.acycms.com/202005-tradingcup2018/dist/acysecurities/en/9f6a1cfed1d903763bae8375969178b7.png"></p><p>Name</p><p>Mr. Shaotao Yu</p><p>Prize($USD)</p><p>$US84,000</p><p>%Return</p><p>29.12%</p></div><div class="prize2-small"><p><img src="https://lprsc.acycms.com/202005-tradingcup2018/dist/acysecurities/en/cec90e985123366766a3f377a9de0cb2.png"></p><p>Name</p><p>Mr. Guilin Li</p><p>Prize($USD)</p><p>$US24,000</p><p>%Return</p><p>21.42%</p></div><div class="prize3-small"><p><img src="https://lprsc.acycms.com/202005-tradingcup2018/dist/acysecurities/en/1b67c4b14f8a24cafdfe2b9d3029f165.png"></p><p>Name</p><p>Mr. Yarang Wu</p><p>Prize($USD)</p><p>$US2,000</p><p>%Return</p><p>20.30%</p></div></div></div><div class="interview"><div class="stage1"><div style="overflow: hidden;"><div class="ant-carousel"><div class="slick-slider stage1-carousel slick-initialized" dir="ltr"><div class="slick-list"><div class="slick-track" style="width: 10780px; opacity: 1; transform: translate3d(-980px, 0px, 0px);"><div data-index="-1" tabindex="-1" class="slick-slide slick-cloned" aria-hidden="true" style="width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Thank you for sharing with us, Mr. Yu! And congratulations again. We hope to see you again in 2019 Asia Trading Cup and win a million cash prize! </p><p>Mr. Yu: Thank you! I am glad to be here. </p></div></div></div></div><div data-index="0" class="slick-slide slick-active slick-current" tabindex="-1" aria-hidden="false" style="outline: none; width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Hi, Mr. Yu, congratulation on winning the 2018 Asia Trading Cup. Could you give us a brief introduction of yourself?</p><p>Mr. Yu: Sure! My name is Yu. I am thrilled to participate in the 2018 Asia Trading Cup, and thanks to this competition for my BMW dream. I work as a real estate agent.  However, after work, I consider myself a serious trader. </p></div></div></div></div><div data-index="1" class="slick-slide" tabindex="-1" aria-hidden="true" style="outline: none; width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: What about pre-competition? Did you do any preparation before the contest?</p><p>Mr. Yu: Yes, I did. Because I am more familiar with EUR/USD, I mainly use the Moving Average indicator to analyse this currency pair before the contest. The trick is to apply different moving average that emphasize on the activities of EUR/USD in different periods. Notably, a few minutes before and after nfp (non-farm payroll) data was released, I spent the most time on studying the 1-minute moving average, 3-minute moving average, and 5-minute moving average. Analysing it helped me place my first trade and point me in the right direction.</p></div></div></div></div><div data-index="2" class="slick-slide" tabindex="-1" aria-hidden="true" style="outline: none; width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Could you describe your trading style and strategies to us?</p><p>Mr. Yu: Gladly! I like to spot trading opportunities in high-volatile forex pairs. And I believe that the most volatile market happens after a currency pair just experienced a significant market shift. For example, I often get into the market once a dominant trend hits its turning point and get out before it turns again. I think I can use the word “scalping” to describe my trading strategy. But like I said, volatility is the key. The more fluctuate it gets, the more profits I can make.</p></div></div></div></div><div data-index="3" class="slick-slide" tabindex="-1" aria-hidden="true" style="outline: none; width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Did you apply this strategy during the contest? And did you use any other strategies in the contest? </p><p>Mr. Yu: Yes, I did apply this strategy during the contest, and it did help me. However, I think what led to my ultimate success were my experiences with EUR/USD and my habit to trade in large positions. In my day to day trading, I develop a habit of raising positions when I spot trading opportunities. This habit shaped my trading mentality and enabled me to have the right mindset in the contest and led to my success.</p></div></div></div></div><div data-index="4" class="slick-slide" tabindex="-1" aria-hidden="true" style="outline: none; width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Thank you for sharing with us, Mr. Yu! And congratulations again. We hope to see you again in 2019 Asia Trading Cup and win a million cash prize! </p><p>Mr. Yu: Thank you! I am glad to be here. </p></div></div></div></div><div data-index="5" tabindex="-1" class="slick-slide slick-cloned" aria-hidden="true" style="width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Hi, Mr. Yu, congratulation on winning the 2018 Asia Trading Cup. Could you give us a brief introduction of yourself?</p><p>Mr. Yu: Sure! My name is Yu. I am thrilled to participate in the 2018 Asia Trading Cup, and thanks to this competition for my BMW dream. I work as a real estate agent.  However, after work, I consider myself a serious trader. </p></div></div></div></div><div data-index="6" tabindex="-1" class="slick-slide slick-cloned" aria-hidden="true" style="width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: What about pre-competition? Did you do any preparation before the contest?</p><p>Mr. Yu: Yes, I did. Because I am more familiar with EUR/USD, I mainly use the Moving Average indicator to analyse this currency pair before the contest. The trick is to apply different moving average that emphasize on the activities of EUR/USD in different periods. Notably, a few minutes before and after nfp (non-farm payroll) data was released, I spent the most time on studying the 1-minute moving average, 3-minute moving average, and 5-minute moving average. Analysing it helped me place my first trade and point me in the right direction.</p></div></div></div></div><div data-index="7" tabindex="-1" class="slick-slide slick-cloned" aria-hidden="true" style="width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Could you describe your trading style and strategies to us?</p><p>Mr. Yu: Gladly! I like to spot trading opportunities in high-volatile forex pairs. And I believe that the most volatile market happens after a currency pair just experienced a significant market shift. For example, I often get into the market once a dominant trend hits its turning point and get out before it turns again. I think I can use the word “scalping” to describe my trading strategy. But like I said, volatility is the key. The more fluctuate it gets, the more profits I can make.</p></div></div></div></div><div data-index="8" tabindex="-1" class="slick-slide slick-cloned" aria-hidden="true" style="width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Did you apply this strategy during the contest? And did you use any other strategies in the contest? </p><p>Mr. Yu: Yes, I did apply this strategy during the contest, and it did help me. However, I think what led to my ultimate success were my experiences with EUR/USD and my habit to trade in large positions. In my day to day trading, I develop a habit of raising positions when I spot trading opportunities. This habit shaped my trading mentality and enabled me to have the right mindset in the contest and led to my success.</p></div></div></div></div><div data-index="9" tabindex="-1" class="slick-slide slick-cloned" aria-hidden="true" style="width: 980px;"><div><div tabindex="-1" style="width: 100%; display: inline-block;"><div class="interview-words"><p>ACY reporter: Thank you for sharing with us, Mr. Yu! And congratulations again. We hope to see you again in 2019 Asia Trading Cup and win a million cash prize! </p><p>Mr. Yu: Thank you! I am glad to be here. </p></div></div></div></div></div></div></div></div></div><div class="stage1-arrows"><span role="img" aria-label="left" tabindex="-1" class="anticon anticon-left stage1-arrows-both"><svg viewBox="64 64 896 896" focusable="false" class="" data-icon="left" width="1em" height="1em" fill="currentColor" aria-hidden="true"><path d="M724 218.3V141c0-6.7-7.7-10.4-12.9-6.3L260.3 486.8a31.86 31.86 0 000 50.3l450.8 352.1c5.3 4.1 12.9.4 12.9-6.3v-77.3c0-4.9-2.3-9.6-6.1-12.6l-360-281 360-281.1c3.8-3 6.1-7.7 6.1-12.6z"></path></svg></span><span role="img" aria-label="right" tabindex="-1" class="anticon anticon-right stage1-arrows-both stage1-arrows-right"><svg viewBox="64 64 896 896" focusable="false" class="" data-icon="right" width="1em" height="1em" fill="currentColor" aria-hidden="true"><path d="M765.7 486.8L314.9 134.7A7.97 7.97 0 00302 141v77.3c0 4.9 2.3 9.6 6.1 12.6l360 281.1-360 281.1c-3.9 3-6.1 7.7-6.1 12.6V883c0 6.7 7.7 10.4 12.9 6.3l450.8-352.1a31.96 31.96 0 000-50.4z"></path></svg></span></div></div></div><div class=